import Form from "./Form";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Table from "./Table";
import Edit from "./Edit";

function App() {
  return (
    <Router>
      <div className="app">
        {/* <Navbar /> */}
        <main className="main">
          <Routes>
            <Route path="/index.html" element={<Form />} />
            <Route path="/table.html" element={<Table />} />
            <Route path="/edit.html" element={<Edit />} />

            {/* <Route path="/blogs/:id" element={<Edit />} />
            <Route path="*" element={<NotFound />} />  */}
          </Routes>
        </main>
      </div>
    </Router>
  );
}

export default App;
